window.RandoStuffs.OoT.viewModes.helpDocs.goto_link = null; // is assigned in ...helpDocs.init()

window.RandoStuffs.OoT.viewModes.helpDocs.init = function(workspace){

	workspace.textContent = '';
	let mode = document.createElement('div');
	workspace.appendChild(mode);


	mode.style.position = 'absolute';
	mode.style.inset = 0;
	mode.style.display = 'flex';
	mode.style.flexDirection = 'column';
	//mode.style.justifyContent = 'center';
	mode.style.alignItems = 'center';
	mode.style.flexWrap = 'wrap';
	mode.style.overflowX = 'scroll';

    //
    let _lang = 'EN';

    let handle = document.createElement('div');
    handle.style.margin = '32px 8px';
    mode.append(handle);

    let container = handle.attachShadow({mode:'closed'});
    DEBUG_EXPORT__docsContainer = container;

    let allLangElements = [];
    let get_allLangElements = ()=>{
        allLangElements = [...container.querySelectorAll('.switchable-language')];
    };
    let switch_lang = ()=>{
        allLangElements.forEach(e=>e.innerHTML=e.theDocs[_lang]);
    };

    // select language list input
    (()=>{
        let lang = document.createElement('select');
        lang.innerHTML = '<option value="EN">English</option>'
                       + '<option value="FR">Fran√ßais</option>';
        lang.style.position = 'absolute';
        lang.style.top = 16;
        lang.style.right = 16;
        lang.onchange = function(){
            _lang=this.value;
            switch_lang();
        };
        
        mode.append(lang);
    })();

    // DOCUMENTATION BODY
    ((EN='', FR='')=>{

        // main css style
        let styleTag = document.createElement('style');
        styleTag.textContent = `
            .switchable-language{
                white-space : pre-wrap;
            }
            h1{
                background-color : white;
            }
            h2{
                background-color : white;
                padding : 0px 32px;
            }
            h1+div{
                margin-left : 32px;
            }
            h2+div{
                margin-left : 64px;
            }
            div{
                margin-right : 32px;
            }
        `;
        container.append(styleTag)

        // mini lib of functions
        let make_switchableLangElem = (tagName, multiLangObject)=>{
            let elem = document.createElement(tagName);
            elem.classList.add('switchable-language');
            elem.theDocs = multiLangObject;
            return elem;
        };

        let make_image = (src, marginLvl)=>{
            let elem = document.createElement('img');
            elem.src = src;
            elem.style.border = '1px solid black';
            elem.style.marginLeft = 32 * marginLvl;
            elem.width = 800;
            return elem;
        };

        let goto_link = 'window.RandoStuffs.OoT.viewModes.helpDocs.goto_link';
        window.RandoStuffs.OoT.viewModes.helpDocs.goto_link = (event, targetID)=>{
            event.preventDefault();
            let e = container.querySelector('#'+targetID);
            mode.scroll(0, e.offsetTop);
        };

        let make_inTextPageLink = (txt, targetID)=>{
            return `<a href="" onclick="${goto_link}(event,'${targetID}');">${txt}</a>`;
        };

        // images (data url pack)
        let IMG = {
            'quick_start'        : 'data:image/png;base64,',
            'spoiler_slot_error' : 'data:image/png;base64,',
            'next'               : '',
        };

        // Page Index Table :
        let make_pageIndexTable = (()=>{
            EN = `Page index table :`;
            FR = `Table d'index de la page :`;
            let title = make_switchableLangElem('div', {EN,FR});
            let body = document.createElement('div');
            let table = document.createElement('div');
            table.appendChild(title);
            table.appendChild(body);
            container.append(table);

            return (()=>{
                // automatic build
                let elems = [...container.querySelectorAll('h1,h2,h3')];
                elems.forEach(e=>{
                    let elem = make_switchableLangElem('a', e.theDocs);
                    elem.href = '';
                    elem.style.display = 'block';
                    if(e.tagName === 'H1') elem.style.marginLeft = 8;
                    if(e.tagName === 'H2') elem.style.marginLeft = 16;
                    if(e.tagName === 'H3') elem.style.marginLeft = 24;
                    elem.onclick = (event)=>{
                        event.preventDefault();
                        mode.scroll(0, e.offsetTop);
                    };
                    body.appendChild(elem)
                });
            });
        })(); // never move this code block !

        // Docs start
        //

        let htmlElem = null;

        // [intro]
        (()=>{
            // - title
            EN = `Introduction`;
            FR = `Introduction`;
            htmlElem = make_switchableLangElem('h1', {EN,FR});
            htmlElem.id = 'TITLE-introduction';
            container.append(htmlElem);
            // - text
            EN = `Basically "Zelda Ocarina of Time Randomizer" provides spoiler file containing the exact position of each item that has been randomized, `
               + `and the randomizer also provides some labeled data "WotH / Way of the Hero", `
               + `however maybe you prefer to have a better controle on the precision and the quantity of information to `
               + `allow you to orient more effectively your next random game sessions of OoT. `
               + `In that case, this application can maybe feed some needs `
               + `by providing more hints about choosen items without revealing their exact position, `
               + `all that trying to be the most settable and customizable possible.`
            FR = `A la base "Zelda Ocarina of Time Randomizer" fournit un fichier spoiler contenant la position exact de chaque item qui a √©t√© "randomis√©", `
               + `et le randomizer fournit aussi des donn√©es labelis√©es "WotH / Way of the Hero - Voie du H√©ro", `
               + `cependant peut-√™tre preferez-vous avoir un meilleur controle sur la pr√©cision et la quantit√© d'information afin de `
               + `vous permetre d'orienter plus efficacement vos prochaines parties randomis√©es de OoT. `
               + `Dans ce cas, cette application peut eventuellement combler certains besoins `
               + `en fournissant d'avange d'indices √† porpos d'items choisis sans reveler leur position exact, `
               + `le tout en tentant d'√™tre le plus parametrable et plus customizable possible.`;
            htmlElem = make_switchableLangElem('div', {EN,FR});
            container.append(htmlElem);
        })();

        // [main concept & minimum requirement]
        (()=>{
            // - title
            EN = `Main concept and Minimum requirement`;
            FR = `Concept principal et Minimum requis`;
            htmlElem = make_switchableLangElem('h1', {EN,FR});
            htmlElem.id = 'TITLE-mainConceptMinReq';
            container.append(htmlElem);

                // [[main concept]]
                (()=>{
                    // - title
                    EN = `Main concept`;
                    FR = `Concept principal`;
                    htmlElem = make_switchableLangElem('h2', {EN,FR});
                    htmlElem.id = 'TITLE-mainConcept';
                    container.append(htmlElem);
                    // link
                    let below = make_inTextPageLink('below', 'TITLE-quickStart');
                    let bas = make_inTextPageLink('bas', 'TITLE-quickStart');
                    // - text
                    EN = `In a Spoiler.json file, the exact position of an item is called a 'location'. `
                       + `In this app, each OoTR 'location' will be put within a major (3D) 'area', `
                       + `which is linked to a Hyrule 'map position' point, `
                       + `which actually represents one of the geographic points on the (in-game) pause menu Hyrule map. `
                       + `In more, each "OoTR location" and each "major area", gets a "list of properties" totally customizable. `
                       + `Once this in mind, we can do some request to get info or hints by according choosen items, `
                       + `and of course we can define request parameters and even add some conditions to increase/decrease the amount of revealed data.\n`
                       + `(A visual diagram showing relations between : 'Locations' / 'Areas' / 'Map Positions' / "lists of properties", `
                       + `is available ${below} in this docs.)`;
                    FR = `Dans un fichier Spoiler.json, la position exacte d'un item est appel√©e une 'location'. `
                       + `Dans cette application, chaque 'location' de OoTR va √™tre mise dans une 'zone' (3D) majeur, `
                       + `laquelle est li√©e √† un point de 'position sur la carte' d'Hyrule, `
                       + `lequel repr√©sent en fait un des points g√©ographiques sur la carte d'Hyrule du menu pause (en jeu). `
                       + `En plus de cela, chaque "location de OoTR" et chaque "zone majeur", obtienne une "liste de propri√©t√©s" totalement customisables. `
                       + `Une fois ceci √† l'esprit, on peut effectuer des requetes pour obtenir des infos ou des indices selon des items choisis, `
                       + `et bien s√ªr on peut definir des parametres de requete et m√™me ajouter des conditions pour augmenter/diminuer le total d'informations r√©v√©l√©es.\n`
                       + `(Un sch√©ma visuel montrant les relations entre : les 'Locations' / les 'Zones' / les 'Positions sur la carte' / les "listes de propri√©t√©s", `
                       + `est disponible plus ${bas} dans ce document.)`;
                    htmlElem = make_switchableLangElem('div', {EN,FR});
                    container.append(htmlElem);
                })();

                // [[minimum requirement]]
                (()=>{
                    // - title
                    EN = `Minimum requirement`;
                    FR = `Minimum requis`;
                    htmlElem = make_switchableLangElem('h2', {EN,FR});
                    htmlElem.id = 'TITLE-minimumRequirement';
                    container.append(htmlElem);
                    // - text
                    EN = `In absolute, the minimum requirement, is just to be able to provide a spoiler.json file.\n`
                       + `In relative, for now the app is usuable online, which is stored on 'GitHub Pages' servers, `
                       + `whiches have a visit limit of 100GB per month, and so while this limit is not reached, not to need to download the app. `
                       + `But in the case where to download the app is necessary, no worries to run it in local mode, `
                       + `and so just run the 'main.html' file, which is located in [downloaded folder of the app] at its root.\n`
                       + `In all cases, it is recommended to use the app with a web browser based on the (Google) Chrome engine, `
                       + `the app having been developped and tested only with Google Chrome.`;
                    FR = `Dans l'absolu, le minimum requis, est seulement d'√™tre en mesure de fournir un fichier spoiler.json.\n`
                       + `En relatif, pour l'instant l'application est utilisable en ligne, laquelle est stock√©e sur les serveurs 'GitHub Pages', `
                       + `lequels ont une limite de visite de 100 Go par mois, et donc tant que cette limite n'est pas atteinte, pas besoin de t√©l√©charger l'application. `
                       + `Mais dans le cas o√π il est n√©cessaire de t√©l√©charger l'application, pas de soucis pour l'ex√©cuter en mode local, `
                       + `et il suffit juste d'ex√©cuter le fichier 'main.html', lequel est situ√© dans [le dossier t√©l√©charg√© de l'application] √† sa racine.\n`
                       + `Dans tout les case, il est recommand√© d'utiliser l'application avec un navigateur web bas√© sur le moteur de (Google) Chrome, `
                       + `l'application ayant √©t√© d√©velopp√©e et test√©e seulement avec Google Chrome.`;
                    htmlElem = make_switchableLangElem('div', {EN,FR});
                    container.append(htmlElem);
                })();
        })();

        // [how to use (step by step)]
        (()=>{
            // - title
            EN = `How to use (Step by step)`;
            FR = `Comment utiliser (√©tape par √©tape)`;
            htmlElem = make_switchableLangElem('h1', {EN,FR});
            htmlElem.id = 'TITLE-howToUseByStep';
            container.append(htmlElem);

                // [[quick start]]
                (()=>{
                    // - title
                    EN = `Quick start`;
                    FR = `D√©marrage rapide`;
                    htmlElem = make_switchableLangElem('h2', {EN,FR});
                    htmlElem.id = 'TITLE-quickStart';
                    container.append(htmlElem);
                    // - text
                    EN = `To use directly with default the "lists of properties" for "areas" / "locations" :\n\n`
                       + `\t1. Drag and drop your 'spoiler.json' file on dashed rect box at the window's top left corner.\n\n`
                       + `\t2. Click on 'Item Request View' in the left side menu.\n\n`;
                    FR = `Pour utiliser directement avec les "listes de propri√©t√©s" par defaut des "zones" / "locations" :\n\n`
                       + `\t1. "Glissez et d√©posez" votre fichier 'spoiler.json' sur la boite en rectagle pointill√© dans le coin haut gauche de la f√™netre.\n\n`
                       + `\t2. Cliquez sur 'Item Request View' dans le menu du cot√© gauche.\n\n`;
                    htmlElem = make_switchableLangElem('div', {EN,FR});
                    container.append(htmlElem);
                    // - image
                    htmlElem = document.createElement('img');
                    htmlElem = make_image(IMG.quick_start, 2);
                    container.append(htmlElem);
                })();
        })();

        // compile all titles to build the main page index table
        make_pageIndexTable(); // needs this current scope

    })();

    // the order of call is very important
    get_allLangElements();
    switch_lang();
};